import './Navbar.css';
import logo from '../../Asserts/Logos/kiddostardez.png';
import React, { useState, useEffect, useRef } from 'react';
import useWindowDimensions from '../../hooks/useWindowDimension';
import Aboutus from '../../Pages/Aboutus/Aboutus';
import Discover from '../../Pages/Discover/Discover';
import Myaccount from '../../Pages/Myaccount/Myaccount';
import UserInterface from '../../User/Userinterface';
import { BrowserRouter, NavLink, Route, Routes } from 'react-router-dom';  
import Home from '../../Pages/Home/Home'


function Navbar() {
  const { height, width } = useWindowDimensions();
  let navHeight = height / 3

  return ( 
<div>


          <BrowserRouter> 
          <img
                src={logo} alt="Kiddostardez logo"
                style={{ width: '150px', height: '150px',position: 'absolute', top: '0', left: '0', margin: '10px'  }}
                />

                    <div style={{
   
   flexDirection: 'row',
   alignItems: 'flex-end',
   position: 'absolute',
   top: 0,
   right: 0,
   padding: '10px',
   margin:'20px'
}}>
                  
                      <NavLink  exact to="/" style={{color: 'white', marginRigth:"0px"}} activeClassName="active">Home</NavLink>
                      <NavLink exact to="/AboutUs"  style={{color: 'white', marginLeft:"20px"}} activeClassName="active">About us</NavLink> 
                      <NavLink exact to="/Discover"   style={{color: 'white', marginLeft:"20px"}} activeClassName="active">Discover</NavLink> 
                      <NavLink exact to="/MyAccount"  style={{color: 'white', marginLeft:"20px"}} activeClassName="active">My Account</NavLink> 
                    </div>

                    <Routes>
                      <Route exact path="/" Component={<Home/>}/>
                      <Route exact path="/aboutus" Component={<Aboutus/>}/>
                      <Route exact path="/discover" Component={<Discover/>}/>
                      <Route exact path="/myAccount" Component={<Myaccount/>}/>
                    </Routes>
    
              </BrowserRouter>


                          <div style={{
                            color:'while',
                            display: 'flex',
                            flexDirection: 'column', 
                            alignItems: 'center',
                            height: navHeight,
                            margin:'0px',
                            backgroundColor: '#800080',
                            
                          }}>
                                          <pre className='title'><br/><br/>
                                            <div className='title1'><h1>w e   a r e</h1></div><br/><br/>
                                    
                                              <div className='title2'><h1>we are</h1></div>
                                          <div className='title3'><h1>KIDDOS TRADEZ</h1></div>
                                        
                                            
                                          </pre>

                          </div>
   </div>
    
  );
}
export default Navbar;
